(90, 198, 'Giới thiệu', 'gioi-thieu', '', '<table style="color: #000000; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 16px; text-align: justify; word-spacing: 1px; height: 25px; background-color: #b4e1ff; border: 0px solid;" width="100%" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 14px; color: #ffffff;"><strong><span style="color: #000000;"><a name="#khaiquat" title="#khaiquat"></a>KHÁI QUÁT</span></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Tháng 3-2006, Khoa Thư viện – Thông tin Trường Cao đẳng Sư phạm Tp. Hồ Chí Minh được Ông Hiệu trưởng Trường CĐSP Tp. HCM - TS.CVCC Nguyễn Viết Ngoạn - kí quyết định thành lập.</p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Tháng 10-2006, Khoa đã đào tạo khoá đầu tiên trình độ Cao đẳng ngành Thư viện – Thông tin.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;">Tháng 1-2007, Khoa được bổ sung nhiệm vụ đào tạo ngành Lưu trữ học.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Tháng 9-2007, Khoa Thư viện - Thông tin Trường Đại học Sài Gòn được Ông Hiệu trưởng Trường Đại học Sài Gòn - TS.CVCC Nguyễn Viết Ngoạn - kí quyết định thành lập.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Tháng 10-2008, Khoa đào tạo khoá đầu tiên ngành Thư viện - Thông tin trình độ đại học.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Nguồn sinh viên đào tạo trên phạm vi toàn quốc. Khoa đã xây dựng được chương trình và kế hoạch đào tạo với nội dung và phương thức đào tạo được các chuyên gia của ngành thư viện – thông tin đánh giá là hiện đại và thiết thực, đáp ứng được yêu cầu cấp bách hiện nay của các cơ sở tuyển dụng cán bộ thư viện, cán bộ lưu trữ, thư kí văn phòng, chuyên viên của các trung tâm thông tin, v.v.</p>\r\n<table style="color: #000000; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 16px; text-align: justify; word-spacing: 1px;" width="90%" border="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td><a href="http://www.sgu.edu.vn/thuvienvanphong/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=160&amp;lang=vi#khaiquat" style="color: #02437d;"><strong>Khái quát</strong></a> </td>\r\n<td><a href="http://www.sgu.edu.vn/thuvienvanphong/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=160&amp;lang=vi#nhiemvu" style="color: #02437d;"><strong>Nhiệm vụ</strong></a></td>\r\n<td><a href="http://www.sgu.edu.vn/thuvienvanphong/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=160&amp;lang=vi#chuongtrinh" style="color: #02437d;"><strong>Chương trình</strong></a></td>\r\n<td><a href="http://www.sgu.edu.vn/thuvienvanphong/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=160&amp;lang=vi#hoptac" style="color: #02437d;"><strong>Hợp tác quốc tế</strong></a></td>\r\n<td><a href="http://www.sgu.edu.vn/thuvienvanphong/index.php?option=com_content&amp;view=article&amp;id=18&amp;Itemid=160&amp;lang=vi#cohoi" style="color: #02437d;"><strong>Cơ hội cho người học</strong></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<table style="color: #000000; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 16px; text-align: justify; word-spacing: 1px; height: 25px; background-color: #b4e1ff; border: 0px solid;" width="100%" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 14px; color: #ffffff;"><strong><span style="color: #000000;">NHIỆM VỤ<a name="nhiemvu" title="nhiemvu"></a></span></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">1. Đào tạo nhân viên thư viện trình độ cao đẳng và đại học có tri thức và nghiệp vụ thư viện – thông tin, có kĩ năng công nghệ thông tin để làm việc ở tất cả các loại hình thư viện, đặc biệt là các thư viện ở Tp. Hồ Chí Minh. Với năng lực này, người được đào tạo còn có khả năng làm việc ở văn phòng của các cơ quan, công ti, doanh nghiệp, v.v.<br />2. Đào tạo nhân viên lưu trữ trình độ cao đẳng và đại học có tri thức và nghiệp vụ lưu trữ, có kĩ năng công nghệ thông tin để khai thác, lưu trữ và sử dụng thông tin, tư liệu cho các trung tâm thông tin tư liệu của các cơ quan hành chính các cấp, các tổ chức xã hội, đoàn thể, các công ti, doanh nghiệp, v.v. trên phạm vi toàn quốc, đặc biệt là Tp. Hồ Chí Minh.<br />3. Tổ chức nghiên cứu và hợp tác nghiên cứu khoa học theo những dự án phục vụ cho việc đào tạo, bồi dưỡng nhằm phát triển nghiệp vụ thư viện - thông tin và lưu trữ ở Việt Nam theo tiêu chuẩn thế giới, đặc biệt là việc xây dựng và phát triển thư viện trường học của Việt Nam.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<table style="color: #000000; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 16px; text-align: justify; word-spacing: 1px; height: 25px; background-color: #b4e1ff; border: 0px solid;" width="100%" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 14px; color: #ffffff;"><strong><span style="color: #000000;">CHƯƠNG TRÌNH<a name="chuongtrinh" title="chuongtrinh"></a></span></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Trên cơ sở chương trình khung ngành Thư viện – Thông tin và ngành Lưu trữ học được Bộ Giáo dục và Đào tạo quy định, căn cứ vào nhu cầu về nguồn nhn lực của Tp. Hồ Chí Minh và vào sứ mệnh của Trường Đại học Sài Gòn, việc đào tạo ngành Thư viện – Thông tin và ngành Lưu trữ học của Khoa chú trọng vào việc tăng cường kĩ năng nghiệp vụ cho người học.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Để thực hiện yêu cầu này, nội dung đào tạo tập trung vào những vấn đề sau đây : <br />1. Tiếp cận tiêu chuẩn của thế giới trong việc đào tạo với những nội dung thuộc chuyên ngành Thư viện – Thông tin và Lưu trữ học : Thư viện - Thông tin học, Lưu trữ học, Khung phân loại DDC, Biên mục mô tả, Biên mục đề mục, Tham khảo, Mạng thông tin, Thiết kế và quản trị trang web, Các phần mềm quản trị thư viện, Thư viện số, Tổ chức và quản lí thư viện, v.v.<br />2. Tăng cường năng lực ngôn ngữ cho sinh viên với ngôn ngữ chính là tiếng Việt, cùng với những tri thức cơ bản về Hán Nôm  và hai ngoại ngữ là tiếng Anh và tiếng Pháp. <br />3. Tổ chức thực tập thường xuyên trải đều hàng tuần trong toàn khoá học. Sinh viên được thực tập ở tất cả các loại hình thư viện, các cơ quan hành chính, các công ti, doanh nghiệp, v.v. theo những chuyên đề quy định. <br />4. Tổ chức cho sinh viên thực hiện khoá luận tốt nghiệp.</p>\r\n<p class="caption" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<table style="color: #000000; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 16px; text-align: justify; word-spacing: 1px; height: 25px; background-color: #b4e1ff; border: 0px solid;" width="100%" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 14px; color: #ffffff;"><strong><span style="color: #000000;">HƠP TÁC QUỐC TẾ<a name="hoptac" title="hoptac"></a></span></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Thực hiện chủ trương của Trường Đại học Sài Gòn trong việc mở rộng quan hệ hợp tác quốc tế, Khoa Thư viện – Thông tin Trường Đại học Sài Gòn sẽ hợp tác với một số khoa chuyên ngành của các đại học trong khu vực và trên thế giới nhằm trao đổi kinh nghiệm đào tạo, trao đổi giảng viên và trao đổi sinh viên trong việc đào tạo ngành Thư viện – Thông tin và ngành Lưu trữ học.</p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<table style="color: #000000; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 16px; text-align: justify; word-spacing: 1px; height: 25px; background-color: #b4e1ff; border: 0px solid;" width="100%" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 14px; color: #ffffff;"><strong><span style="color: #000000;">CƠ HỘI CHO NGƯỜI HỌC<a name="cohoi" title="cohoi"></a></span></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;"> </p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Với một chương trình và một phương thức đào tạo hiện đại, thiết thực, với những thiết bị hiện đại của Trung tâm học liệu Trường Đại học Sài Gòn, người học ngành Thư viện – Thông tin và ngành Lưu trữ học tại Khoa Thư viện – Thông tin Trường Đại học Sài Gòn có điều kiện thể hiện và tích luỹ năng lực của mình trong suốt khoá học qua việc tự học và tự nghiên cứu tại thư viện, qua việc làm những bài tập ngắn (assignment) theo cá nhân hoặc theo nhóm, qua việc thực tập thường xuyên tại ở các loại hình thư viện và các cơ quan, văn phòng, v.v. Mục tiêu cuối cùng là người học có được một hệ thống kĩ năng nghiệp vụ hoàn chỉnh đáp ứng được yêu cầu của các cơ sở tuyển dụng. Khả năng được tuyển dụng cho người học do vậy có thể rất cao.<br /><br />Có thể truy cập website <a href="http://www.sgu.edu.vn/" style="color: #02437d;">www.sgu.edu.vn</a> và <a href="http://www.flis.sgu.edu.vn/" style="color: #02437d;">www.flis.sgu.edu.vn</a> </p>\r\n<p> </p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Hoặc liên hệ với Khoa Thư viện – Thông tin Trường Đại học Sài Gòn, 273 An Dương Vương, Quận 5, Tp. Hồ Chí Minh, điện thoại (08)38337083, E.mail :  <a href="mailto:sguflias@yahoo.com" style="color: #02437d;">k_thuvienthongtin@sgu.edu.vn</a></p>', '', 1, 0, 0, 77, '2012-01-06 04:21:22', 995, '', '2013-08-14 15:51:40', 42, 0, '0000-00-00 00:00:00', '2012-01-06 04:21:22', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 15, 0, 1, '', '', 1, 60, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
