(57, ' Hội thảo khoa học "Đào tạo nghiệp vụ Thư viện - Thông tin chuẩn hoá"', 'hoi-thao-khoa-hoc-dtnvtv', 4, 1, '<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Ngày 09-01-2009, Trường Đại học Sài Gòn phối hợp với Liên chi hội Thư viện Đại học phía Nam tổ chức Hội thảo khoa học "<strong>Đào tạo nghiệp vụ Thư viện - Thông tin chuẩn hoá</strong>". Các chuyên gia Thư viện - Thông tin trong nước và nước ngoài, các nhà quản lí, Hội Thư viện Việt Nam, v.v. sẽ trình bày nhận xét phản biện Chương trình đào tạo trình độ đại học ngành Thư viện - Thông tin của Khoa Thư viện - Thông tin Trường Đại học Sài Gòn và những vấn đề trọng tâm của việc đào tạo nghiệp vụ Thư viện - Thông tin của Khoa Thư viện - Thông tin Trường Đạo học Sài Gòn.</p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Hội thảo khoa học này được sự tài trợ của Công ti cổ phần IESVN (Nhà tài trợ chính) và Công ti CDMEX, Công ti cổ phần Đầu tư và Phát triển Giáo dục Phương Nam (các Nhà đồng tài trợ).</p>', '', NULL, NULL, '[]', '', '2013-08-03 11:41:50', 42, '', 0, '0000-00-00 00:00:00', '2013-08-03 12:00:05', 42, '2013-08-03 11:41:50', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, 'hình 1', 'hình1', '', '', 18, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2