(58, 'Hội thảo khoa học "Đào tạo nghiệp vụ Thư viện - Thông tin chuẩn hoá"', 'hoi-thao-khoa-hoc', 4, 1, '<p style="margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Ngày 09-01-2009, Trường Đại học Sài Gòn phối hợp với Liên chi hội Thư viện Đại học phía Nam tổ chức Hội thảo khoa học "<strong style="margin: 0px; padding: 0px; border: 0px; outline: 0px; background-color: transparent;">Đào tạo nghiệp vụ Thư viện - Thông tin chuẩn hoá</strong>". Các chuyên gia Thư viện - Thông tin trong nước và nước ngoài, các nhà quản lí, Hội Thư viện Việt Nam, v.v. sẽ trình bày nhận xét phản biện Chương trình đào tạo trình độ đại học ngành Thư viện - Thông tin của Khoa Thư viện - Thông tin Trường Đại học Sài Gòn và những vấn đề trọng tâm của việc đào tạo nghiệp vụ Thư viện - Thông tin của Khoa Thư viện - Thông tin Trường Đạo học Sài Gòn.</p>\r\n<p style="margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Hội thảo khoa học này được sự tài trợ của Công ti cổ phần IESVN (Nhà tài trợ chính) và Công ti CDMEX, Công ti cổ phần Đầu tư và Phát triển Giáo dục Phương Nam (các Nhà đồng tài trợ).</p>', '', NULL, NULL, '[]', '', '2013-08-09 14:21:08', 42, '', 0, '0000-00-00 00:00:00', '2013-08-09 14:38:08', 42, '2013-08-09 14:21:08', '0000-00-00 00:00:00', 0, 1, 2, 0, 0, '', '', '', '', 11, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*'),
(59, 'Lễ tốt nghiệp chính quy 2013', 'lễ-tốt-nghiệp-chính-quy-2013', 4, 1, '<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Được sự chỉ đạo của Ban Giám Hiệu Trường Đại học Sài Gòn, vào lúc 08g ngày 07/08/2013, Khoa Thư viện – Văn phòng long trọng tổ chức Lễ tốt nghiệp hệ chính quy cho sinh viên các ngành Đại học Thư viện –Thông tin khóa 09; Cao đẳng Thư viện  - Thông tin, Quản trị Văn phòng, Thư kí văn phòng khóa 10 tại hội trường A.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Đến dự lễ, về phía nhà trường có PGS.TS. Võ Văn Lộc, Trợ lý hiệu trưởng; TS. Trịnh Xuân Thu, Trưởng phòng Thiết bị - Phương tiện dạy học; ThS. Nguyễn Thị Như Uyên, Phó phòng Công tác Học sinh - Sinh viên.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Về phía Ban Chủ nhiệm Khoa có TS. Nguyễn Văn Bằng, Trưởng khoa Thư viện – Văn phòng cùng các cán bộ, giảng viên của Khoa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Về phía Giảng viên thỉnh giảng của Khoa có ThS. Dương Thúy Hương, GĐ TV Trường Đại học Khoa học Tự nhiên. Cùng đại diện Công Ty TNHH XNK &amp; Phát triển văn hóa. Lễ khai giảng còn có sự tham gia của 161“ tân cử nhân”  khóa 09, 10 ở các ngành Đại học Thư viện –Thông tin; Cao đẳng Thư viện –Thông tin; Quản trị Văn phòng, Thư kí văn phòng.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Trong phát biểu khai mạc buổi lễ, TS. Nguyễn Văn Bằng thay mặt toàn thể cán bộ, giảng viên của Khoa, đọc diễn văn bế giảng khóa học và chúc mừng tới 161 “ tân cử nhân”. ThS. Đặng Thanh Nam, giảng viên Khoa công bố Quyết định công nhận Tốt nghiệp và Quyết định khen thưởng sinh viên tốt nghiệp thủ khoa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Tại buổi lễ, PGS.TS. Võ Văn Lộc cũng gửi lời chúc mừng đến tất cả các tân cử nhân nhận bằng tốt nghiệp.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Tân cử nhân Lê Thị Ngọc Hà, thay mặt cho tất cả các bạn sinh viên  phát biểu bày tỏ lòng biết ơn tới nhà trường, Ban chủ nhiệm Khoa, các thầy cô đã tạo điều kiện cho sinh viên trong những năm học tập tại trường.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Buổi lễ  kết thúc thành công tốt đẹp, trong niềm vui mừng của toàn thể cán bộ, giảng viên và các tân cử nhân Khoa Thư viện – Văn phòng.</span><span style="line-height: 12.4pt; text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Sau đây là một số hình ảnh của buổi lễ:</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; text-align: justify; word-spacing: 1px; text-indent: 31.5pt; line-height: 18px;"> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/1.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">Văn nghệ chào mừng buổi lễ tốt nghiệp</span><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/2.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 16px; line-height: 16.53125px; text-align: justify;">Văn nghệ chào mừng buổi lễ tốt nghiệp</span><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/3.jpg" border="0" style="border-style: none;" /></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">Văn nghệ chào mừng buổi lễ tốt nghiệp</span><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/4.jpg" border="0" style="border-style: none;" /></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">TS. Nguyễn Văn Bằng đọc diễn văn bế giảng khóa học</span><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/5.jpg" border="0" style="border-style: none;" /></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">PGS.TS. Võ Văn Lộc gửi lời chúc mừng đến </span><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;"> </span><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">các tân cử nhân</span><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/6.jpg" border="0" style="border-style: none;" /> <span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">ThS. Đặng Thanh Nam công bố Quyết định công nhận Tốt nghiệp và khen thưởng sinh viên tốt nghiệp thủ khoa</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/7.jpg" border="0" style="border-style: none;" /><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">Tân cử nhân Lê Thị Ngọc Hà phát biểu bày tỏ lòng biết ơn tới nhà trường, Ban chủ nhiệm Khoa và thầy cô</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/10.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">PGS.TS. Võ Văn Lộc và TS. Nguyễn Văn Bằng trao giấy khen và phần thưởng cho sinh viên tốt nghiệp thủ khoa</span> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/8.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">TS. Nguyễn Văn Bằng trao bằng tốt nghiệp cho các tân cử nhân</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/LETOTNGHIEP2013/9.jpg" border="0" style="border-style: none;" /><span style="text-indent: 31.5pt;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 31.5pt; line-height: 18px;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt; line-height: 12.4pt; text-align: justify; text-indent: 31.5pt;">TS. Nguyễn Văn Bằng trao bằng tốt nghiệp cho các tân cử nhân</span> </p>', '', NULL, NULL, '[]', '', '2013-08-14 14:31:33', 42, '', 0, '0000-00-00 00:00:00', '2013-08-14 17:28:01', 42, 