(60, 'Chung kết hội thi nghiệp vụ cho các ngành đào tạo', 'chung-kết-hội-thi-nghiệp-vụ-cho-các-ngành-đào-tạo', 7, 1, '<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 27pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Nhằm thực hiện phương hướng năm học tập trung mục tiêu rèn luyện kĩ năng nghiệp vụ của các ngành đào tạo, vào lúc 8h ngày 18/05/2013, Khoa Thư viện – Văn phòng đã tổ chức thành công chung kết hội thi nghiệp vụ cho 4 ngành đào tạo : Thư viện –Thông tin, Lưu trữ học, Quản trị văn phòng và Thư kí văn phòng.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 27pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Đến tham dự, về phía Khoa có TS. Nguyễn Văn Bằng, Trưởng khoa Thư viện – Văn phòng cùng toàn thể các giảng viên, chuyên viên và sinh viên của Khoa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 27pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Về phía Ban giám khảo có ThS. Nguyễn Minh Hiệp, nguyên GĐ TV Trường Đại học Khoa học Tự nhiên Tp. Hồ Chí Minh; ThS. Dương Thúy Hương, GĐ TV Trường Đại học Khoa học Tự nhiên; TS.Phan Đình Nham, giảng viên Trường Đại học KHXH &amp; NV Tp. Hồ Chí Minh; ThS. Hoàng Thị Phương Thúy, giảng viên Khoa; MC Phú Lộc và MC Phương Thảo, đài truyền hình TP. Hồ Chí Minh.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 27pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Trong phát biểu khai mạc hội thi nghiệp vụ, TS. Nguyễn Văn Bằng thay mặt toàn thể cán bộ, giảng viên của Khoa, cảm ơn đến các giảng viên và các vị khách mời đến tham dự hội thi. Đây là cơ hội để sinh viên có điều kiện tích hợp các kiến thức và kĩ năng qua hai phần thi trình bày thông tin và dẫn chương trình.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 27pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Thông qua hội thi đã giúp cho tất cả sinh viên Khoa Thư viện –Văn phòng, có cơ hội giao lưu học hỏi lẫn nhau, góp phần tạo thành sân chơi bổ ích tạo điều kiện để  tăng thêm kiến thức, kỹ năng nghiệp vụ.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 27pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Sau đây là một số hình ảnh của hội thi:</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 18px;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/HoithiNV/1.png" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">TS. Nguyễn Văn Bằng phát biểu khai mạc hội thi nghiệp vụ</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/HoithiNV/2.png" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Ban giám khảo hội thi</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/HoithiNV/3.png" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Ban giám khảo hội thi</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/HoithiNV/4.png" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">ThS. Nguyễn Minh Hiệp, ThS. Dương Thúy Hương</span><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;"> trao giải thưởng cho  sinh vi</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/HoithiNV/5.png" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">MC Phú Lộc, ThS. Hoàng Thị Phương Thúy</span><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;"> trao giải thưởng cho sinh viên </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/HoithiNV/6.png" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 27pt; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">TS.Nguyễn Văn Bằng, TS.Phan Đình Nham trao giải thưởng cho sinh viên </span></p>', '', NULL, NULL, '[]', '', '2013-08-14 15:09:00', 42, '', 0, '0000-00-00 00:00:00', '2013-08-14 17:29:21', 42, '2013-08-14 15:09:00', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, '', '', '', '', 5, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*'),
(61, 'Búp sen xanh - Chân dung Hồ Chủ tịch', 'búp-sen-xanh-chân-dung-hồ-chủ-tịch', 8, 1, '<h2 class="lead" style="font-weight: bold; font-size: 13px; line-height: normal; font-family: arial; color: #000000;">Tên Người là Hồ Chí Minh. Trẻ em Việt Nam gọi Người với cái tên thân thương là Bác Hồ. Nhân dịp kỷ niệm 120 năm ngày sinh của Bác, chuyên mục Sách hay báo Ngoisao xin giới thiệu với độc giả yêu sách những tác phẩm đáng chú ý viết về người lãnh tụ vĩ đại của đất nước.</h2>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;"><span style="font-weight: bold;">1. Búp sen xanh</span> <br /> - Tác giả: Sơn Tùng<br /> - Số trang: 356<br /> - Giá: 45.000 đồng</p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;">Nói về cuốn sách này, cố thủ tướng Phạm Văn Đồng đã viết: <br />Chúng ta có một khẩu hiệu rất đúng, rất hay: "Chủ tịch Hồ Chí Minh vĩ đại sống mãi trong sự nghiệp của chúng ta". Đúng như vậy, Hồ Chủ tịch sống mãi trong tư tưởng và tình cảm lớn, trong toàn bộ hoạt động cách mạng của nhân dân Việt Nam, của mọi người chúng ta. Đồng thời Hồ Chủ tịch cũng sống mãi trong những tác phẩm văn học và nghệ thuật có giá trị diễn tả một cuộc đời đã trở thành lịch sử, những trang sử đẹp nhất và vẻ vang nhất của dân tộc.</p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;"><img src="http://c0.f23.img.vnecdn.net/2010/05/06/1-485495-1368111915_500x0.jpg" border="0" width="380" height="296" style="display: block; margin-left: auto; margin-right: auto;" /></p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;">Tôi muốn nói đôi điều về cuốn tiểu thuyết "Búp sen xanh" của nhà văn Sơn Tùng, mà nhiều độc giả, nhất là trong giới thanh, thiếu niên ưa thích; và báo chí nước ta đã đăng những bài bình luận và đánh giá mà theo tôi biết, tác giả rất chú trọng. Cuốn sách "Búp sen xanh" nêu lên một vấn đề: ở đây tiểu thuyết và lịch sử có thể gặp nhau không? Vấn đề này các đồng chí hoạt động trong lĩnh vực văn học và nghệ thuật và nói chung tất cả chúng ta cần suy nghĩ để có thái độ. Song ở đây cũng vậy, lời nói có trọng lượng rất lớn thuộc về người đọc, nghĩa là nhân dân.</p>', '', NULL, NULL, '[]', '', '2013-08-14 15:11:07', 42, '', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '2013-08-14 15:11:07', '0000-00-00 00:00:00', 1, 1, 1, 0, 0, '', '', '', '', 0, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"",