(63, 'Từ làng Sen - Chân dung Hồ Chủ tịch', 'tu-lang-sen', 8, 1, '<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;"><span style="font-weight: bold;">Từ làng Sen</span> <br />- Tác giả: Lê Lam - Sơn Tùng <br />- Số trang: 36 <br />- Giá bán: 20 000 đồng</p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;">Tên Người là Hồ Chí Minh. Trẻ em Việt Nam gọi Người là Bác Hồ.<br />Nói cho đúng, Người có nhiều tên gọi. Hồ Chí Minh là một trong vô số những tên do Người tự đặt cho mình để thoát khỏi sự theo dõi ráo riết của cảnh sát nhiều nước.<br />Chính là Người đã làm nên Điện Biên Phủ, chiến thắng đã giành lại nền độc lập cho nước Việt Nam. Người đã theo đuổi cho đến hơi thở cuối cùng cuộc đấu tranh chống chủ nghĩa thực dân mới.</p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;">Không nhân nhượng về nguyên tắc, mềm dẻo và thực tế trong thực hiện, là nhà thơ tùy hứng, bạn thân của trẻ con và những con người bình thường, Người được nhân dân cả nước tôn sùng và có uy tín quốc tế thực sự. Tổ chức LHQ về khoa học, giáo dục, văn hóa (UNESCO) đã kỷ niệm 100 năm ngày sinh của Người vào năm 1990 trên toàn thế giới.</p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;">Cuốn sách tranh <em>Từ Làng Sen</em> có quan hệ khăng khít với <em>Búp Sen Xanh</em>, gồm 25 bức tranh mà mỗi bức là một cảm thụ, một thi hứng với một ý tứ đã đúc kết nên hình ảnh trọn vẹn. Những hình ảnh đó chính là gia đình, quê hương, trường học và các sự kiện nóng bỏng trên khắp đất nước đã tạo nên cốt cách, tâm hồn, tư tưởng và chí hướng tìm đường cứu nước của Bác.</p>\r\n<p class="Normal" style="font-size: 13px; line-height: normal; font-family: arial; color: #000000; margin: 13px 0px;">Hai tác giả của <em>Từ Làng Sen</em> rất tâm huyết khắc họa dăm ba "giọt nước nhỏ" trong Biển-Cả-Bác-Hồ để cùng các em nhỏ tưởng nhớ và biết ơn Người.</p>', '', NULL, NULL, '[]', '', '2013-08-14 15:20:18', 42, '', 0, '0000-00-00 00:00:00', '2013-08-14 15:30:34', 42, '2013-08-14 15:20:18', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, '', '', '', '', 6, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemR