INSERT INTO `tvvp_k2_items` (`id`, `title`, `alias`, `catid`, `published`, `introtext`, `fulltext`, `video`, `gallery`, `extra_fields`, `extra_fields_search`, `created`, `created_by`, `created_by_alias`, `checked_out`, `checked_out_time`, `modified`, `modified_by`, `publish_up`, `publish_down`, `trash`, `access`, `ordering`, `featured`, `featured_ordering`, `image_caption`, `image_credits`, `video_caption`, `video_credits`, `hits`, `params`, `metadesc`, `metadata`, `metakey`, `plugins`, `language`) VALUES
(66, '10 thư viện lớn nhất thế giới ', '10-thư-viện-lớn-nhất-thế-giới', 6, 1, '<div class="lead" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 17px; font-weight: bold; color: #5e5e5e; line-height: 1.2; font-family: ''times new roman''; background-color: #eeeeee;">Hãy cùng đến với những kho tri thức khổng lồ của nhân loại nào!</div>\r\n<div class="content" style="margin: 0px; padding: 0px; border: 0px; color: #000000; font-family: arial; line-height: 16px; background-color: #eeeeee;">\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Thông tin và kiến thức là những thứ mang lại cho ta trí tuệ và sự tinh thông, tất nhiên, kèm theo đó là những kinh nghiệm được đúc kết. Làm sao chúng ta có thể nắm bắt được quá khứ và biết được các sự kiện từng diễn ra? Hãy cùng tiếp cận những kho tàng tri thức của loài người thông qua những thư viện khổng lồ sau nhé!</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-weight: bold;">Thư viện quốc hội Hoa Kỳ</span></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="center"><img src="http://l.f18.img.vnecdn.net/2012/04/29/thuvienquochoihoaky-963219-1371146411_500x0.jpg" border="1" alt="thuvienquochoihoaky-963219-1371146411_50" style="margin: 0px; padding: 0px; font-size: 0px; color: transparent; vertical-align: middle;" /></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Xây dựng vào năm 1800, bao gồm một bộ sưu tập sách khổng lồ, đáng kinh ngạc với hơn 30.000.000 đầu sách với đủ các kiểu ngôn ngữ trên thế giới – đó chính là Thư viện quốc hội Hoa Kỳ ở thủ đô Washington D.C, Mỹ. Đây cũng là thư viện mà diễn viên gạo cội Hollywood Nicholas Cage tìm kiếm cuốn sách bí mật đi tìm kho báu trong bộ phim Kho báu quốc gia II. Đến nay, thư viện này vẫn được nhiều nhà làm phim đưa vào trong các tác phẩm của mình vì thiết kế uy nghi, hùng vĩ và số lượng sách sưu tập có một không hai của nó.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Khi cuộc chiến tranh giữa Hoa Kỳ và Anh xảy ra năm 1812, phần lớn bộ sưu tập sách cổ đã bị bán đi, không lâu sau đó, Tổng thống Thomas Jefferson đã nhượng lại cho thư viện bộ sưu tập sách của ông, với số lượng lên đến 6.457 cuốn. Ngày nay, thư viện là trung tâm nghiên cứu của Quốc hội Hoa kỳ, và mặc dù được mở rộng rãi cho công chúng thì chỉ những quan chức cấp cao Mỹ mới có quyền tra cứu sách tại đây.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-weight: bold;">Thư viện quốc gia Trung Quốc</span></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="center"><img src="http://l.f17.img.vnecdn.net/2012/04/29/thuvienquocgiatrungquoc-397967-1371146432_500x0.jpg" border="1" alt="thuvienquocgiatrungquoc-397967-137114643" style="margin: 0px; padding: 0px; font-size: 0px; color: transparent; vertical-align: middle;" /></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Là thư viện lớn nhất Châu Á, thư viện quốc gia Trung Quốc ở Bắc Kinh sở hữu khoảng 26,3 triệu đầu sách, nổi tiếng là nơi lưu trữ số lượng tài liệu và các bản thảo viết tay về lịch sử Trung Quốc hàng đầu thế giới.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Năm 1909, Nhà Thanh thành lập thư viện này, nhưng mãi cho đến năm 1912, sau cách mạng Tân Hợi, nó mới chính thức đi vào hoạt động. Một phần trong bộ sưu tập sách khổng lồ của thư viện là các bản thảo từ thời cổ đại (được Thư viện Hoàng gia Wenyuange cung cấp) cùng những bản ghi chép được viết lên các bản khắc từ thời nhà Thanh. Bên cạnh đó, cũng có rất nhiều thư viện lớn nhỏ khác nhau khắp Trung Quốc đóng góp vào bộ sưu tập khổng lồ của thư viện, gồm cả các bản thảo có niên đại hàng ngàn năm trước. Thư viện này còn có trong tay các bản thảo ghi chép trên xương và mai rùa riêng của mình, cùng các cuốn sách và sách thực hành với khoảng 115 loại ngôn ngữ khác nhau.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-weight: bold;">Thư viện của Viện Khoa học hàn lâm Nga</span></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="center"><img src="http://l.f19.img.vnecdn.net/2012/04/29/thuviencuavienkhoahochanlamnga-483503-1371146444_500x0.jpg" border="1" alt="thuviencuavienkhoahochanlamnga-483503-13" style="margin: 0px; padding: 0px; font-size: 0px; color: transparent; vertical-align: middle;" /></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Thư viện của Viện Khoa học hàn lâm Nga nằm ở thành phố Saint Petersburg được chính phủ Liên bang Nga trao đặc quyền sưu tầm sách và các công trình nghiên cứu trên toàn quốc. Thư viện chỉ mở cho các đối tượng là công nhân viên chức là thành viên của Viện Khoa học hàn lâm Nga và những người học cao, với nguồn tài liệu là các bản ghi chép về các tổ chức từ thiện, giới khoa học, nhà văn và những nghiên cứu của công dân Nga.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Thư viện được Sa Hoàng Peter đệ nhất tài trợ năm 1714, và vào năm 1774, nó được quyền sao chép miễn phí mọi bản thảo, công trình nghiên cứu của bất cứ viện khoa học hay cá nhân nào. Nhờ đó, cho đến nay, số đầu sách cùng công trình nghiên cứu khoa học đã lên đến con số 20.000.000. Mặc dù, đã có một vài vụ hỏa hoạn xảy ra khiến cho một số lượng lớn các cuốn sách bị thiêu hủy, nhưng đến nay người ta vẫn chưa thể kê khai hết được số sách được khôi phục sau các vụ hỏa hoạn.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-weight: bold;">Thư viện và cơ quan lưu trữ Canada</span></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="center"><img src="http://l.f20.img.vnecdn.net/2012/04/29/thuvienvacoquanluutrucanada-330463-1371146450_500x0.jpg" border="1" alt="thuvienvacoquanluutrucanada-330463-13711" style="margin: 0px; padding: 0px; font-size: 0px; color: transparent; vertical-align: middle;" /></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Thư viện và cơ quan lưu trữ Canada được xây dựng tại thủ phủ Ottawa, là nơi dành riêng cho việc duy trì và bảo tồn lịch sử đất nước Canada, chính thức được biết đến với cái tên Viện lưu trữ quốc gia. Tòa nhà của thư viện có chiều rộng bằng 2 sân vận động bóng đá cộng lại, gồm 48 gian phòng lưu trữ, phòng thí nghiệm và phòng nghiên cứu có hệ thống điều chỉnh nhiệt độ với con số đầu tư lên đến 89 triệu đô la. Một trong các cuốn sách cổ nhất viết về lục địa Bắc Mỹ bởi Flavius Josephus - sử gia đầu tiên của thế kỷ 15, in năm 1470 có trong kho sách của thư viện. Cuốn sách này cùng một số cuốn sách quan trọng khác được bảo quản một cách cẩn mật và chỉ những người có đặc quyền mới có thể chiêm ngưỡng và sử dụng chúng.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Ngoài ra, thư viện cũng lưu trữ và bảo quản rất nhiều ấn phẩm của các nhà xuất bản khác nhau. Cho đến nay, thư viện có trong tay một bộ sưu tập khổng lồ với 18.800.000 đầu sách cùng rất nhiều tài liệu liên quan đến lịch sử ở đủ mọi thể loại.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;"><span style="margin: 0px; padding: 0px; border: 0px; font-weight: bold;">Thư viện quốc gia Đức</span></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="center"><img src="http://l.f18.img.vnecdn.net/2012/04/29/thuvienquocgiaduc2-366864-1371146454_500x0.jpg" border="1" alt="thuvienquocgiaduc2-366864-1371146454_500" style="margin: 0px; padding: 0px; font-size: 0px; color: transparent; vertical-align: middle;" /></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="center"><img src="http://l.f17.img.vnecdn.net/2012/04/29/thuvienquocgiaduc3-636292-1371146459_500x0.jpg" border="1" alt="thuvienquocgiaduc3-636292-1371146459_500" style="margin: 0px; padding: 0px; font-size: 0px; color: transparent; vertical-align: middle;" /></p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Thư viện quốc gia Đức tọa lạc tại thành phố Frankfurt có trong tay bộ sưu tập sách với số lượng vào khoảng 18.500.000 cuốn. Thành lập với mục đích lưu trữ toàn bộ các ấn phẩm và băng đĩa liên quan đến lịch sử của nước Đức, thư viện đã và đang mang trên mình trọng trách lớn lao và rất đáng tự hào.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;">Điểu ấn tượng là thư viện này còn lưu giữ các ấn phẩm viết về các cuộc chiến tranh thế giới I, II cùng các tài liệu tuyên truyền của các nước có tham gia vào chiến tranh. Thư viện còn có một chi nhánh khác với mục đích thu thập, lưu giữ và trưng bày tất cả các băng đĩa âm nhạc đã được phát hành tại Đức cùng 200.000 ấn phẩm âm nhạc liên quan. Trên thực tế, thư viện quốc gia Đức có 3 cơ sở, một ở Frankfurt, một ở Berlin và một ở Leipzig, cộng gộp số sách, tài liệu băng đĩa ở ba cơ sở này thì con số lên đến 24.100.000 vật phẩm. Chính phủ liên bang có đề ra một dự luật, với nội dung, bất cứ ai xuất bản một ấn phẩm nào đó ở phạm vi trong nước đều phải có nghĩa vụ cung cấp bản sao của ấn phẩm đó cho thư viện, để thư viện bổ sung thêm vào bộ sưu tập của mình, nếu không, sẽ phải chịu trách nhiệm trước hành vi gây cản trở công việc mà chính phủ đang thi hành.</p>\r\n<p class="Normal" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-size: 12.2pt; color: #333333; font-family: ''Times New Roman'', Times, serif; line-height: 15pt;" align="right"><span style="margin: 0px; padding: 0px; border: 0px; font-weight: bold;">Donkey Luffy</span></p>\r\n</div>', '', NULL, NULL, '[]', '', '2013-08-14 15:32:32', 42, '', 0, '0000-00-00 00:00:00', '2013-08-14 17:30:59', 42, '2013-08-14 15:32:32', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, '', '', '', '', 8, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory"