(67, 'Về việc tổ chức Lễ tốt nghiệp năm học 2012 – 2013', 'về-việc-tổ-chức-lễ-tốt-nghiệp-năm-học-2012-–-2013', 11, 1, '<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 22.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Căn cứ công văn số: 870/ĐHSG-ĐT ngày 04/06/2013 của Hiệu trưởng trường Đại học Sài Gòn về việc kết thúc năm học 2012 – 2013.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 22.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Khoa trân trọng thông báo đến sinh viên  các lớp  DTV 1091, DTV 1092, CTV1101, CQV 1101, CQV 1102, CTK 1101 về việc tổ chức Lễ tốt nghiệp như sau:</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 22.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Thời gian tổ chức: <strong>7giờ, ngày 07/8/2013</strong></span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 22.5pt; line-height: 18px;"><span style="font-size: 12pt; line-height: 24px; font-family: ''Times New Roman'', serif;">Địa điểm: <strong>Hội trường A, Cở sở chính - 273 An Dương Vương, P3, Q.5.</strong></span></p>\r\n<div style="color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; word-spacing: 1px;"><span style="font-family: ''Times New Roman'', serif; font-size: 16px; line-height: 24px; text-align: justify; text-indent: 30px;">       Đề nghị Bí thư và Lớp trưởng các lớp liên hệ Văn phòng khoa vào </span><span style="font-family: ''Times New Roman'', serif; font-size: 16px; line-height: 24px; text-align: justify; text-indent: 30px;">ngày 06/8/2013 để lấy danh sách sinh viên nhận lễ phục tốt nghiệp.</span> </div>', '', NULL, NULL, '[]', '', '2013-08-14 15:35:25', 42, '', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '2013-08-14 15:35:25', '0000-00-00 00:00:00', 0, 1, 2, 0, 0, '', '', '', '', 11, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"",