(68, 'Lễ bảo vệ Khóa luận Tốt nghiệp dành cho sinh viên hệ đại học khóa 9 và cao đẳng khóa 10 ngành Thư viện  -Thông tin', 'lễ-bảo-vệ-khóa-luận-tốt-nghiệp-dành-cho-sinh-viên-hệ-đại-học-khóa-9-và-cao-đẳng-khóa-10-ngành-thư-viện-thông-tin', 7, 1, '<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Vào lúc 8h ngày 31/5/2013, Khoa Thư viện –Văn phòng long trọng  tổ chức Lễ bảo vệ Khóa luận Tốt nghiệp dành cho sinh viên hệ đại học khóa 9 và cao đẳng khóa 10 ngành Thư viện  -Thông tin tại phòng D201. Đây là hoạt động khoa học nằm trong quy hoạch của nhà trường và kế hoạch đào tạo của Khoa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Đến dự lễ có TS. Nguyễn Văn Bằng, Trưởng khoa Thư viện – Văn phòng cùng toàn thể các giảng viên, chuyên viên và sinh viên của Khoa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Thay mặt Ban Chủ nhiệm khoa, ThS. Nguyễn Trần Tiến đã đọc quyết định thành lập Hội đồng chấm khóa luận tốt nghiệp.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Theo Quyết định của Nhà trường, Hội đồng chấm khóa luận gồm các thành viên:</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">+ Chủ tịch hội đồng: TS. Nguyễn Văn Bằng, Trưởng khoa Thư viện – Văn phòng ;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">+ Ủy viên hội đồng: ThS. Nguyễn Minh Hiệp, nguyên GĐ TV Trường Đại học Khoa học Tự nhiên Tp. Hồ Chí Minh; ThS. Dương Thúy Hương, GĐ TV Trường Đại học Khoa học Tự nhiên; ThS. Âu Thị Cẩm Linh, GĐ TV Trường Đại học Mở, ThS. Lê Ngọc Oánh,  giảng viên Khoa;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">+ Thư ký hội đồng: ThS. Nguyễn Trần Tiến, Trợ lí đào tạo Khoa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Mở đẩu buổi lễ, TS. Nguyễn Văn Bằng gửi lời cảm ơn đến giảng viên trong khoa đã  giúp đỡ sinh viên hoàn thành khóa luận tốt nghiệp. Đồng thời Thầy vui mừng phấn khởi và đánh giá rất cao sự cố gắng của 7 sinh viên trong việc thực hiện khóa luận.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Sau phần lễ khai mạc, các sinh viên thực hiện đề tài đã lần lượt báo cáo đề tài của mình trước sự theo dõi của hội đồng chấm khóa luận và giảng viên, sinh viên tham dự.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: justify; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Buổi lễ diễn ra thành công tốt đẹp trong không khí vui mừng của sinh viên, thầy cô và bạn bè.</span><span style="font-size: 10pt; font-family: Tahoma, sans-serif;"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-size: 12pt; font-family: ''Times New Roman'', serif;">Sau đây là một số hình ảnh của buổi lễ:</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 0.25in; line-height: 14.9pt;"> <img src="http://www.sgu.edu.vn/thuvienvanphong/upload/BAOVEKHOALUAN/1.jpg" border="0" style="border-style: none;" /></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"><span style="line-height: 16px; text-align: center; text-indent: 0px; font-size: 10pt; font-family: Tahoma, sans-serif;">                                                                 </span><span style="line-height: 16px; text-align: center; text-indent: 0px; font-size: 12pt; font-family: ''Times New Roman'', serif;">Hội đồng đánh giá khóa luận tốt nghiệp</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 0.25in; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/BAOVEKHOALUAN/2.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"><span style="line-height: 16px; text-align: center; text-indent: 0px; font-size: 10pt; font-family: Tahoma, sans-serif;">                                                                </span><span style="line-height: 16px; text-align: center; text-indent: 0px; font-size: 12pt; font-family: ''Times New Roman'', serif;">Hội đồng đánh giá khóa luận tốt nghiệp</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 0.25in; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/BAOVEKHOALUAN/3.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"><span style="line-height: 16px; text-align: center; text-indent: 0px; font-size: 10pt; font-family: Tahoma, sans-serif;">                                                                 </span><span style="line-height: 16px; text-align: center; text-indent: 0px; font-size: 12pt; font-family: ''Times New Roman'', serif;">Hội đồng đánh giá khóa luận tốt nghiệp</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 0.25in; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/BAOVEKHOALUAN/4.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-family: ''Times New Roman'', serif; font-size: 16px; line-height: 16px; text-align: center; text-indent: 0px;">                                                                     Sinh viên báo cáo đề tài khóa luận</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-align: center; text-indent: 0.25in; line-height: 14.9pt;"><img src="http://www.sgu.edu.vn/thuvienvanphong/upload/BAOVEKHOALUAN/5.jpg" border="0" style="border-style: none;" /> </p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 5px; color: #000000; font-family: Helvetica, Arial, sans-serif; word-spacing: 1px; text-indent: 0.25in; line-height: 14.9pt;"><span style="font-family: ''Times New Roman'', serif; font-size: 16px; line-height: 16px; text-align: center; text-indent: 0px;">                                                                    Sinh viên báo cáo đề tài khóa luận</span> </p>', '', NULL, NULL, '[]', '', '2013-08-14 15:35:59', 42, '', 0, '0000-00-00 00:00:00', '2013-08-14 17:25:07', 42, '2013-08-14 15:31:18', '0000-00-00 00:00:00', 0, 1, 2, 0, 0, '', '', '', '', 9, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catI