(69, 'Công đoàn cơ sở Trường Đại học Sài Gòn tổ chức Hội nghị tập huấn công tác nghiệp vụ cho Cán bộ công đoàn năm học 2012-2013', 'công-đoàn-cơ-sở-trường-đại-học-sài-gòn-tổ-chức-hội-nghị-tập-huấn-công-tác-nghiệp-vụ-cho-cán-bộ-công-đoàn-năm-học-2012-2013', 7, 1, '<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-size: 16px;"><span style="font-family: Arial;">Theo sự chỉ đạo của Đảng ủy – Ban Giám hiệu, ngày 30, 31 tháng 7 năm 2013 tại  Bình Châu – Hồ Cốc,  Công đoàn cơ sở Trường Đại học Sài Gòn tổ chức Hội nghị tập huấn công tác nghiệp vụ cho Cán bộ công đoàn năm học 2012-2013. </span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"> </div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-family: Arial; font-size: 16px;">             </span><span style="font-size: 16px;"><span style="font-family: Arial;">Tham dự Hội nghị tập huấn có sự hiện diện của: ThS. Võ Duy Lân – Đảng ủy viên, Chánh Văn phòng Đảng ủy; TS Võ Thành Lâm – Đảng ủy viên, Phó Chủ nhiệm UBKT Đảng; Bà Nguyễn Thị Đương – Đảng ủy viên;  BS.CKII. Trịnh Thị Tố Quyên – Trưởng Trạm Y tế; ThS. Mã Thị Khánh Tú – Đảng ủy viên, Chủ tịch Công đoàn Trường; ThS. Trần Ngọc Cẩn – Phó Chủ tịch Công đoàn Trường và hơn 60 Cán bộ công đoàn là Ủy viên Ban Chấp hành Công đoàn Trường, Ban Chấp hành Công đoàn bộ phận.</span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"> </div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-family: Arial; font-size: 16px;">             </span><span style="font-size: 16px;"><span style="font-family: Arial;">Nội dung trọng tâm của Hội nghị tập huấn là triển khai Chương trình – Kế hoạch hoạt động công đoàn năm học 2013-2014 và hướng dẫn một số vấn đề về nghiệp vụ công tác công đoàn; Phổ biến Luật Công đoàn và Bộ Luật Lao động (đã được sửa đổi năm 2012); Tuyên dương, khen thưởng các Cán bộ công đoàn được tặng Bằng khen của Công đoàn Giáo dục Việt Nam và danh hiệu “Người cán bộ công đoàn của chúng tôi” cấp cơ sở  năm 2013 của Liên đoàn Lao động TP.HCM.</span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"> </div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-family: Arial; font-size: 16px;">             </span><span style="font-size: 16px;"><span style="font-family: Arial;">Trong Hội nghị, Công đoàn kết hợp báo cáo chuyên đề về “Bệnh mãn tính không lây” đây là đề tài NCKH cấp Trường của BS.CKII. Trịnh Thị Tố Quyên – Trưởng Trạm Y tế và ThS. Mã Thị Khánh Tú – Chủ tịch Công đoàn Trường thực hiện; Qua đó, hướng dẫn cán bộ công đoàn các cách phòng chống bệnh mãn tính không lây. </span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"> </div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-family: Arial; font-size: 16px;">             </span><span style="font-size: 16px;"><span style="font-family: Arial;">Phần sinh hoạt giao lưu tập thể, Ban tổ chức thực hiện Gameshow với chủ đề “Chủ tịch Tôn Đức Thắng – một nhân cách lớn” và các trò chơi vận động theo nhạc… đã thu hút 100% đại biểu tham gia trong không khí vui tươi, gắn kết giữa các CĐBP. </span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"> </div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-family: Arial; font-size: 16px;">             </span><span style="font-size: 16px;"><span style="font-family: Arial;">Đợt tập huấn đã góp phần nâng cao kiến thức, kỹ năng nghiệp vụ cho đội ngũ cán bộ công đoàn, là niềm động viên tinh thần rất lớn đối với các cán bộ công đoàn và đặc biệt nói lên là sự quan tâm, tin tưởng của Đảng ủy – Ban Giám hiệu Trường Đại học Sài Gòn đối với lực lượng cán bộ công đoàn. </span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px;"><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #000080;"><strong><em><span style="font-size: 16px;"><span style="font-family: Arial;">Một số hình ảnh của Hội nghị tập huấn:</span></span></em></strong></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="font-size: 16px;"><span style="font-family: Arial;"> <img src="http://www.sgu.edu.vn/images/stories/7_8_13_taphuannghiepvucongdoan/image001.jpg" border="0" alt="" width="600" height="400" style="border-style: none;" /></span></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><em><span style="font-size: 16px;"><span style="color: #0000ff;"><span style="font-family: Arial;">Toàn cảnh Hội nghị Tập huấn công tác nghiệp vụ công đoàn</span></span></span></em></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;">