Arial;">phổ biến Luật Công đoàn, Bộ Luật Lao động </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;">(đã được sửa đổi năm 2012)</span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> <img src="http://www.sgu.edu.vn/images/stories/7_8_13_taphuannghiepvucongdoan/image007.jpg" border="0" alt="" width="600" height="446" style="border-style: none;" /></span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;">ThS. Mã Thị Khánh Tú – Chủ tịch công đoàn Trường</span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;">trao Bằng khen của Công đoàn Giáo dục Việt Nam cho các cá nhân</span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #00