mage011.jpg" border="0" alt="" width="600" height="400" style="border-style: none;" /> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;">Toàn thể Đại biểu tham gia “Vận động theo nhạc “</span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> <img src="http://www.sgu.edu.vn/images/stories/7_8_13_taphuannghiepvucongdoan/image013.jpg" border="0" alt="" width="600" height="400" style="border-style: none;" /></span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;">Thi Gameshow “Chủ tịch Tôn Đức Thắng – Một nhân cách lớn”</span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;"><img src="http://www.sgu.edu.vn/images/stories/7_8_13_taphuannghiepvucongdoan/image015.jpg" border="0" alt="" width="600" style="border-style: none;" /> </span></span></em></span></div>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; line-height: 18px; text-align: center;"><span style="color: #0000ff;"><em><span style="font-size: 16px;"><span style="font-family: Arial;">Đội ngũ Cán bộ công đoàn và các Đại biểu khách mời chụp hình lưu niệm </span></span></em></span></div>', '', NULL, NULL, '[]', '', '2013-08-14 16:02:58', 42, '', 0, '0000-00-00 00:00:00', '2013-08-14 17:32:44', 42, '2013-08-14 16:02:58', '0000-00-00 00:00:00', 0, 1, 4, 0, 0, '', '', '', '', 4, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*'),
(70, 'Hội thảo khoa học "Đào tạo nghiệp vụ Thư viện - Thông tin chuẩn hoá"', 'hoi-thao-khoa-hoc', 7, 1, '<p style="margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Ngày 09-01-2009, Trường Đại học Sài Gòn phối hợp với Liên chi hội Thư viện Đại học phía Nam tổ chức Hội thảo khoa học "<strong style="margin: 0px; padding: 0px; border: 0px; outline: 0px; background-color: transparent;">Đào tạo nghiệp vụ Thư viện - Thông tin chuẩn hoá</strong>". Các chuyên gia Thư viện - Thông tin trong nước và nước ngoài, các nhà quản lí, Hội Thư viện Việt Nam, v.v. sẽ trình bày nhận xét phản biện Chương trình đào tạo trình độ đại học ngành Thư viện - Thông tin của Khoa Thư viện - Thông tin Trường Đại học Sài Gòn và những vấn đề trọng tâm của việc đào tạo nghiệp vụ Thư viện - Thông tin của Khoa Thư viện - Thông tin Trường Đạo học Sài Gòn.</p>\r\n<p style="margin: 0px 0px 5px; padding: 0px; border: 0px; outline: 0px; color: #000000; font-family: Helvetica, Arial, sans-serif; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify">Hội thảo khoa học này được sự tài trợ của Công ti cổ phần IESVN (Nhà tài trợ chính) và Công ti CDMEX, Công ti cổ phần Đầu tư và Phát triển Giáo dục Phương Nam (các Nhà đồng tài trợ).</p>', '', NULL, NULL, '[]', '', '2013-08-14 16:10:06', 42, '', 0, '0000-00-00 00:00:00', '2013-08-15 01:20:32', 42, '2013-08-09 14:21:08', '0000-00-00 00:00:00', 0, 1, 3, 1, 0, '', '', '', '', 7, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVid