(182, 'Danh ngôn', '', '<p style="margin-top: 0px; margin-bottom: 5px; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify"><span style="font-family: ''times new roman'', times;"><strong><span style="color: #ffffff;"><img src="images/phat-bieu3_small.jpg" border="0" width="150" height="101" style="float: left; margin-left: 10px; margin-right: 10px;" />"</span><span style="color: #ffffff;">Thực chất việc học ở Đại học hoàn toàn mới, tức là biến đổi quá trình đào tạo sang tự đào tạo. Nội hàm khái niệm người sinh viên chính và phải là con người tự học, tự đào tạo, tự nghiên cứu dưới sự hướng dẫn của các giảng viên, nhất là từ năm học này, chính thức Đại học Sài Gòn đã chuyển sang cơ chế đào tạo theo hệ thống tín chỉ."</span></strong></span></p>\r\n<p style="margin-top: 0px; margin-bottom: 5px; color: #ffffff; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 16px; text-align: justify; word-spacing: 1px;" align="justify"><span style="color: #ffffff; font-family: ''times new roman'', times;"><strong>(PGS. TS Nguyễn Viết Ngoạn - Hiệu trưởng Trường Đại học Sài Gòn)</strong></span></p>', 1, 'user18', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
